    "oiweras084":{
        "id":"oiweras084","html":"\n <li>Roast the chicken (if you’re using a cooked, store-bought chicken, skip this step): Heat oven to 350 degrees. Place a rack in a roasting pan. Rub 1 tablespoon salt around the inside of the cavity, then stuff it with the thyme, lemon and garlic. Tie the legs closed with cooking twine. Rub olive oil over the entire bird, and sprinkle with 1/2 tablespoon salt and the black pepper. Place on the rack and roast for 72 to 80 minutes. After 72 minutes, begin testing for doneness by inserting a meat thermometer into the leg, close to the bone. The chicken is done when the thermometer reads 165 degrees. Remove from oven and set aside to cool.</li>\n <li>When cool enough to handle, remove the skin from the chicken. Use your hands to remove all the meat (remember, it will be hotter internally) and shred into 2-inch strips. If you’re not going to make the salad for a few hours, place the meat in the refrigerator, but be sure to remove it and let come to room temperature for 30 to 45 minutes before serving, to bring out the best flavor.</li>\n <li>Make the dressing: Place all the ingredients except the oil in a food processor and pulse for about 30 seconds, until everything is combined. With the machine on low, slowly drizzle in the oil until dressing is emulsified.</li>\n <li>Assemble the salad: Drizzle pears with lemon juice to prevent them from browning. In a large mixing bowl, combine pears, greens, beans, tomatoes, onion, avocado and half the chicken meat. Add some of the dressing and toss to make sure everything is lightly coated, adding more dressing if needed. Divide the mixture equally among 4 or 6 plates. Lay the rest of the chicken on top and serve immediately, passing the remaining dressing in case people want to add more.</li>\n ","tag":"text","text":"\n Roast the chicken (if you’re using a cooked, store-bought chicken, skip this step): Heat oven to 350 degrees. Place a rack in a roasting pan. Rub 1 tablespoon salt around the inside of the cavity, then stuff it with the thyme, lemon and garlic. Tie the legs closed with cooking twine. Rub olive oil over the entire bird, and sprinkle with 1/2 tablespoon salt and the black pepper. Place on the rack and roast for 72 to 80 minutes. After 72 minutes, begin testing for doneness by inserting a meat thermometer into the leg, close to the bone. The chicken is done when the thermometer reads 165 degrees. Remove from oven and set aside to cool.\n When cool enough to handle, remove the skin from the chicken. Use your hands to remove all the meat (remember, it will be hotter internally) and shred into 2-inch strips. If you’re not going to make the salad for a few hours, place the meat in the refrigerator, but be sure to remove it and let come to room temperature for 30 to 45 minutes before serving, to bring out the best flavor.\n Make the dressing: Place all the ingredients except the oil in a food processor and pulse for about 30 seconds, until everything is combined. With the machine on low, slowly drizzle in the oil until dressing is emulsified.\n Assemble the salad: Drizzle pears with lemon juice to prevent them from browning. In a large mixing bowl, combine pears, greens, beans, tomatoes, onion, avocado and half the chicken meat. Add some of the dressing and toss to make sure everything is lightly coated, adding more dressing if needed. Divide the mixture equally among 4 or 6 plates. Lay the rest of the chicken on top and serve immediately, passing the remaining dressing in case people want to add more.\n ","children":[],"address":"00002-00013-00005-00001-00001-00001-00017-00005-00003-00000-00000",},
